pragma solidity >=0.4.21 <0.6.0;
import {Bits} from "./imported/Bits.sol";
import "./imported/strings.sol";
import "./imported/verify.sol";
pragma experimental "ABIEncoderV2";
contract Short {

    verify.Data data;
    address public owner;
    string name = "Channle";
    mapping(address=>uint) balances;
    mapping(address=>address) identity;
    mapping(uint=>address) addr;
    uint addrCounter = 0;
    using verify for verify.Data;
    uint balA;
    uint balB;
    uint index;

    function Short() public {
        owner = msg.sender;
    }
    //publickeyA, 10
    function setUp(address party, uint deposit) payable{
        identity[msg.sender] = party; 
        balances[party] += msg.value;
        addr[addrCounter++] = msg.sender;
    }

    uint currentBlk;
    uint test1;
    uint test2;
    address test3;
    function getInfor() public returns (uint, uint, uint, uint,address){
       return (block.number, currentBlk, test2, test1,test3);
    }



    function terminate(uint A, uint B, uint round, bytes32 blkhash, byte[] _v, bytes32[] _r, bytes32[] _s) {
        currentBlk = block.number;
        for (uint i=0; i<=2; i++){
            if (identity[addr[0]] == data.verifyshort(A, B, round, blockhash(currentBlk-1+i-2), _v[0],  _r[0], _s[0]) ){
                payout(A, B);
                test1 = 820;
                test2 = i;
                test3 = identity[addr[0]];
                // test3 = data.verifyshort(A, B, round, blkhash, _v[0],  _r[0], _s[0]);
                break;
            }
        }
    }

    function payout(uint A, uint B) public payable {  
        addr[0].send(A);
        addr[1].send(B);
    }
}
